void LoadCharacterTextures()
{
	glGenTextures(256, characterTexture);

	for(int count = 0; count < 256; count++)
	{
		glBindTexture(GL_TEXTURE_2D, characterTexture[count]);
		glTexImage2D(GL_TEXTURE_2D, 0, GL_RGBA, 8, 8, 0, GL_RGBA, GL_UNSIGNED_BYTE, &TEXT_DATA[count]);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST);
		glBindTexture(GL_TEXTURE_2D, 0);
	}
}

void RenderString(const char string[])
{
	glPushMatrix();
	for(const char *index = string; *index != '\0'; index++)
	{
		glBindTexture(GL_TEXTURE_2D, characterTexture[*index]);
			glBegin(GL_TRIANGLE_STRIP);
				glTexCoord2f(0.0f, 0.0f); glVertex2f(0.0f, 0.0f);
				glTexCoord2f(1.0f, 0.0f); glVertex2f(1.0f, 0.0f);
				glTexCoord2f(0.0f, 1.0f); glVertex2f(0.0f, 1.0f);
				glTexCoord2f(1.0f, 1.0f); glVertex2f(1.0f, 1.0f);
			glEnd();
		glBindTexture(GL_TEXTURE_2D, 0);
		glTranslatef(1.0f, 0.0f, 0.0f);
	}
	glPopMatrix();
}

void RenderFormattedString(const char format[], ...)
{
	// Declared this as static because popping it onto the stack
	// every time a string is displayed may be performance intensive.
	static char buffer[1024];

	va_list argumentList;

	// Fetch the argument list:
	va_start(argumentList, format);

	// Write the formatted string to the buffer:
	vsnprintf(buffer, sizeof(buffer), format, argumentList);

	// Free memory:
	va_end(argumentList);

	// Display the formatted string:
	RenderString(buffer);
}
